import React from 'react';

const PresalePage = () => {
  return (
    <div className="bg-gray-800 text-white min-h-screen">
      {/* Header Section */}
      <header className="text-center p-10">
        <h1 className="text-4xl font-bold">Vortrex Token Presale</h1>
        <p className="mt-4 text-xl">Limited time presale available now!</p>
        <button className="mt-6 bg-yellow-500 px-6 py-2 rounded-full">Buy Now</button>
      </header>

      {/* Presale Countdown Section */}
      <section className="text-center py-10">
        <h2 className="text-3xl">Presale Countdown</h2>
        <p className="text-xl mt-4">00:00:00</p>
      </section>

      {/* Security Features Section */}
      <section className="py-10">
        <h2 className="text-3xl text-center">Security Features</h2>
        <p className="mt-4 text-center">
          Your investment is safe with us. We use top-level encryption and have KYC in place.
        </p>
      </section>
    </div>
  );
};

export default PresalePage;
